import React from "react";
import "./App.css";

function GetJson() {
  return [
    {
      id: 1,
      name: "dominic",
      age: 3,
    },
    {
      id: 2,
      name: "ed",
      age: 32,
    },
    {
      id: 3,
      name: "kimin",
      age: 36,
    },
  ];
}

function App() {
  let data = GetJson();

  return (
    <div>
      {data.map((item) => {
        return (
          <div key={item.id}>
            <h3>Person:</h3>
            <ul>
              <li>{item.name}</li>
              <li>{item.age}</li>
            </ul>
          </div>
        );
      })}
    </div>
  );
}

export default App;
